The grids
LIM Wei Rong
The project attempts the New York City gridded master plan, one of the most recognised street network. The gridded plan has been lauded for wayfinding and walkability. In this project the gridded street pattern is superimposed on the site, whilst still taking into consideration the surrounding site context. Three main iterations were carried out with the gridded master plan in mind and imporvement were made within each iterations. The first iteration explores the arrangement of workflow to produce a flexibible system that infers from the context to divide the proposed site. The second iteration as an extention of the first iteration explores the distribution of density based on the surrounding context. The third iteration explores a more indepth subdivision of the plots based on the surrounding context. The third iteration, which employed a mixture of courtyard and staggered building layout gave the best overall results.

wei_rong/iteration3.html.body:
body {
  counter-reset: chapter 2 h1 11 h2 3 h3 0 h4 0 h5 0 h6 0;
}

Iteration 3
In Iteration 3, industrial is introduced as a noise buffer from the Aayer Rajah Expressway and the proposed site is split into two clusters, the cluster nearer to One North industrial park features larger buidling plots for industrial facilities while the cluster nearer to UTown features more residential blocks, parks and retail units. As much as possible the buidlings have their shorter side facing the east-west direction to reduce the overall solar radiation.



 Iteration 3
In iteration 3's stimulation, it was surprising to note that this iteration yielded the least good building, as it has the most spacing between the buildings it was expected to have better view factor and good window ratio. In the stimulation most of the retail shops are registered as bad buildings this is perhaps due to the thickness and relatively low height hence the retail shops are being obstructed by the surrounding taller buildings. 



 Iteration 3.1


      Iteration 3.2
In iteration 3.1 and 3.2 there was marked improvements to the overall good buildings and good windows. This is due to the changes made by reorganising the building layout as well as introducing a staggered formation to allow for more spacing between the buildings for better daylighting and views. Courtyards was introduced as well to improve the overall passive lighting.

wei_rong/discussion.html.body:
body {
  counter-reset: chapter 2 h1 11 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion
In final iteration, towards Utown there is a higher concentration of plots with residential blocks, shops and offices while the plots closer to One North Industrial Park has a higher concentration of industrial buildings. This distribution takes into account the potential students from the teriatry institutions nearer to UTown who may need an accomodation or venue to socialise. While the plots nearer to One North would likely be occupied by more industrial related support companies. 
The plots are further group according to its proximity to Dover Road or AYE. Closer to AYE a row of non polluting type B industrial blocks are introduced as noise buffer from the AYE. Parks are deployed in two manner, a staggered form between the residential blocks and as central parks between commercial buildings, the former provides a potential intimate venue for residents to congregate and the later a potential event space for the office and retail units around.  
As seen with the 3 iterations, attempts have been made to imporve the stimulations with the final iteration giving the best overall result.
A combination of courtyard typology and staggered building layout proved most useful in producing a effective urban model. Although it was noted that the masterplan is planned with the surrounding context in mind however all 3 iterations evaluation discounts the physical surrounding buildings and green spaces and this made the evaluation less precise. A more well rounded evalution would be to consider the locations of green spaces, surrounding building height and locations.

